const listNumbers = [1, 2, 4, 6, 8, 10, 12];
function Numbers() {
  console.log(listNumbers);

  const paintNumbers = listNumbers.map((each) => each);
  console.log(paintNumbers);

  return <li>{each}</li>;
}

export default Numbers;
